const MobileNavigation = () => {
  return (
    <header className="MobileNavigation">
      <ul className="NavigationItems">
        <li className="NavigationLinks">
          <a href="/">home</a>
        </li>
        <li className="NavigationLinks">
          <a href="./about">about</a>
        </li>
        <li className="NavigationLinks">
          <a href="./Projects.js">projects</a>
        </li>
      </ul>
    </header>
  );
};

export default MobileNavigation;
